import {
  Button,
  Input,
  Section,
  SectionBlock,
  SectionTitle,
} from "figma-react-ui-kit";
import React, { useEffect, useState } from "react";
import { checkSharedLink, getFileKey } from "../helpers";
import Logo from "../icons/Logo";
// @ts-ignore
import screen from "../screen.png";

type Props = {
  onSetFileKey: (value: string) => void;
};

export const ShareLink = ({ onSetFileKey }: Props) => {
  const [value, setValue] = useState("");
  const [isValid, setValid] = useState(false);

  const onChange = (e) => {
    setValue(e.target.value);
  };

  const onClick = () => {
    if (isValid) {
      const fileKey = getFileKey(value);
      console.log({ fileKey });
      onSetFileKey(fileKey || "");
    }
  };

  const onKeyDown = (e) => {
    if (e.keyCode === 13) {
      onClick();
    }
  };

  useEffect(() => {
    setValid(checkSharedLink(value + Math.random().toString().slice(5, 10)));
  }, [value]);

  const [show, setShow] = useState(false);

  return (
    <Section className="section-flex-center">
      <SectionBlock>
        <Logo width={60} />
      </SectionBlock>

      <SectionBlock>
        <SectionTitle>
          <span style={{ fontSize: 14 }}>
            Paste your{" "}
            <strong
              onClick={() => setShow((p) => !p)}
              style={{ color: "#18a0fb", cursor: "pointer" }}
            >
              shared link
            </strong>{" "}
            into the input
          </span>
        </SectionTitle>
      </SectionBlock>
      <SectionBlock className="full-section-block">
        <Input
          autoFocus
          value={value}
          onChange={onChange}
          onKeyDown={onKeyDown}
        />
        <Button type="submit" disabled={!isValid} onClick={onClick}>
          Get file sources
        </Button>
      </SectionBlock>
      {show && (
        <div style={{ marginRight: "auto", padding: "0 15px" }}>
          <p style={{ textAlign: "left" }}>
            1. Click on "Share" button
            <br />
            2. Click on "Copy link"
            <br />
            3. Paste copied link in the input
          </p>
          <img
            style={{ border: "1px solid #ddd" }}
            width="200px"
            src="data:image/png;base64,"
          />
        </div>
      )}
    </Section>
  );
};
